  Icon,
  Badge,
  Spacer,
  Link,
  Drawer,
  Divider
} from "native-base";
import {
  DrawerContentScrollView,
  DrawerItem,
  DrawerItemList,
} from "@react-navigation/drawer";

const DrawerContent = (props) => {
  return (
    <Box flex={1}>
      <DrawerContentScrollView {...props}>
        <Box mt={"20px"}>
          <Text>I am testing this draweer</Text>
        </Box>

        <DrawerItem
          icon={() => (
          <HStack>
            <Divider orientation='vertical' thickness="10px" bg='coolGray.200'/>
            <Icon/>
          </HStack>
          )}
          label="Home"
          onPress={() => {}}
          labelStyle={{ color: "blue", paddingLeft: "0px" }}
        />

        <DrawerItem icon={() => <Icon />} label="Home2" onPress={() => {}} />

        <DrawerItem icon={() => <Icon />} label="Home3" onPress={() => {}} />
      </DrawerContentScrollView>
    </Box>
  );
};

export default DrawerContent;
